import React from "react";
import "../../../Styles/Pages/Manage/ManageFourth.scss";
import CheckCircleIcon from "@material-ui/icons/CheckCircle";
import ArrowRightAltIcon from "@material-ui/icons/ArrowRightAlt";

function ManageFourth() {
  return (
    <div className='manageFourth'>
      <div className='manageFourth__left'></div>
      <div className='manageFourth__right'>
        <h1>Subscription Management</h1>
        <p>
          Our solutions give you supreme flexibility in configuring and managing
          your subscription business.
        </p>
        <div className='manageRight__col'>
          <CheckCircleIcon />
          <h3>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Et
            officiis eum aspernat
          </h3>
        </div>
        <div className='learnMore'>
          <h3>Learn More</h3>
          <ArrowRightAltIcon />
        </div>
      </div>
    </div>
  );
}

export default ManageFourth;
